        static void Main(string[] args)
        {
            Console.WriteLine("Starting program...");

            long[] usages = new long[length];

            Console.WriteLine("--------------------------------------");

            for (int i = 0; i < 100; i++)
            {
                Console.WriteLine($"Test # {i + 1}");
                long currentTime;
                usages[i] = DoTest(out currentTime);
                times[i] = currentTime;
                Console.WriteLine($"Current test memory: {SizeSuffix(usages[i], 2)}");
                Console.WriteLine("--------------------------------------");

                GC.Collect();
            }

            Console.WriteLine($"Average memory: {SizeSuffix(CountAverage(usages), 2)}");
            Console.WriteLine($"Average cycle time: {SizeSuffix(CountAverage(times))}");

            Console.ReadLine();
        }

        private static long DoTest(out long time)
        {
            long startMemory = Process.GetCurrentProcess().PrivateMemorySize64;

            Console.WriteLine($"Process memory: {startMemory}");

            //List<dynamic> parsedValeus = new List<dynamic>();
            //List<JContainer> parsedValeus = new List<JContainer>();
            //List<JToken> parsedValeus = new List<JToken>();
            List<JsonObject> parsedValeus = new List<JsonObject>();

            Console.WriteLine("Entering parse cycle...");

            startMemory = Process.GetCurrentProcess().PrivateMemorySize64;
            Console.WriteLine($"Process memory: {startMemory}");

            Stopwatch stopwatch = new Stopwatch();
            stopwatch.Start();

            for (int i = 0; i < 1000; i++)
            {
                //dynamic token = JsonConvert.DeserializeObject(json);
                //JToken token = JsonConvert.DeserializeObject<JToken>(json);
                JsonObject token = JsonConvert.DeserializeObject<JsonObject>(json);
                //parsedValeus.Add(JToken.Parse(json));
                parsedValeus.Add(token);
            }

            stopwatch.Stop();

            time = stopwatch.ElapsedMilliseconds;

            Console.WriteLine("Cycle exited");

            long finalMemory = Process.GetCurrentProcess().PrivateMemorySize64;

            Console.WriteLine($"Process memory: {finalMemory}");
            Console.WriteLine($"GC memory: {GC.GetTotalMemory(true)}");

            long diff = finalMemory - startMemory;

            Console.WriteLine($"Cycle time: {time} ms");

            return diff;
        }

        private static string SizeSuffix(long value, int decimalPlaces = 1)
        {
            if (value < 0) { return "-" + SizeSuffix(-value); }
            if (value == 0) { return "0.0 bytes"; }

            // mag is 0 for bytes, 1 for KB, 2, for MB, etc.
            int mag = (int)Math.Log(value, 1024);

            // 1L << (mag * 10) == 2 ^ (10 * mag) 
            // [i.e. the number of bytes in the unit corresponding to mag]
            decimal adjustedSize = (decimal)value / (1L << (mag * 10));

            // make adjustment when the value is large enough that
            // it would round up to 1000 or more
            if (Math.Round(adjustedSize, decimalPlaces) >= 1000)
            {
                mag += 1;
                adjustedSize /= 1024;
            }

            return string.Format("{0:n" + decimalPlaces + "} {1}",
                adjustedSize,
                SizeSuffixes[mag]);
        }

        private static long CountAverage(long[] values)
        {
            long summ = 0;

            for (int i = 0; i < values.Length; i++)
            {
                summ += values[i];
            }

            return summ / values.Length;
        }
